import '../styles/AppointmentCard.css';
export default function AppointmentCard({ patient, date, time, status }) {
  return (
    <div className="appointment-card">
      <h3>{patient}</h3>
      <p>{date} at {time}</p>
      <p>Status: {status}</p>
    </div>
  );
}
